        bccAPI.getWeightedPrices = function(currency) {
			var url = 'https://bitcoineasycheck.appspot.com/weighted-prices/';

            if (currency) {
		        url = url + currency;
            }

            return {
                success: function(fn) {
					$http.jsonp(url + '?callback=JSON_CALLBACK').success(function(data, status, headers, config) {
						console.log('d:', data);
						fn(data);
					});
                }
            };
        }

        bccAPI.getMarkets = function(symbols) {
            var m = [];
            if (symbols) {
                for (var i = 0; i < symbols.length; i++) {
                    for (var j = 0; j < markets.length; j++) {
                        if (symbols[i] === markets[j].symbol) {
                            m.push(markets[j]);
                            break;
                        }
                    }
                }
            }
            else { // no symbols passed in, default to all markets
                m = markets;
            }
            console.log('getMarkets(). markets:', m);

            return {
                success: function(fn) {
                    fn(m);
                }
            }
        }

